    <style type="text/css">

        /*      Settings     */

        *, *:before, *:after {
            -moz-box-sizing: border-box;
            -webkit-box-sizing: border-box;
            box-sizing: border-box
        }

        html {
            position: relative;
            width: 100%;
            height: 100%;
            overflow-x: hidden;
            background: #f2f2f2 repeat url(../assets.tumblr.com/images/x3860.gif?v=1)
        }

        body {
            position: relative;
            width: 100%;
            min-height: 100%;
            margin: 0;
            padding: 0;
            overflow: hidden;
            font: 12px/2em "Helvetica Neue", sans-serif;
            color: #777777
        }

        a, a:hover {
            cursor: pointer;
            word-wrap: break-word;
            text-decoration: none;
            color: #6e8296
        }

        a:hover {
            color: #239fc5
        }

        img {
            max-width: 100%;
            display: block
        }

        h1, h2, h3, h4, h5 {
            margin: 0 0 15px;
            font: 18px/1.2em "Montserrat", "Helvetica Neue", sans-serif;
            text-shadow: 0 1px 0 1px rgba(0, 0, 0, .3);
            color: #555555
        }

        #permalink h1 {
            font-size: 25px
        }

        #permalink h2 {
            font-size: 23px
        }

        #permalink h3 {
            font-size: 21px
        }

        blockquote {
            padding: 0 0 0 15px;
            margin: 0;
            font-style: italic;
            border-left: 4px solid #efefef
        }

        ul, ol {
            padding: 0
        }

        li {
            list-style-position: inside
        }

        a,
        .like_button,
        #tumblr_controls,
        #header a#slide #icon,
        #header a#slide #icon:before,
        #header a#slide #icon:after,
        #sidebar a#avatar img,
        #sidebar #search input[type="text"],
        #sidebar #instagram #instagram-feed img,
        #sidebar #flickr #flickr-feed img,
        #sidebar #dribbble #dribbble-feed img,
        #sidebar #twitter .content,
        .mfp-fade.mfp-bg,
        .mfp-fade.mfp-wrap .mfp-content {
            -webkit-transition: .2s;
            transition: .2s
        }

        #sidebar,
        #posts-container,
        a#install-button,
        .entry a.overlay,
        .entry .photo-buttons a {
            -webkit-transition: .4s;
            transition: .4s
        }

        a#install-button {
            width: 100px;
            height: 20px;
            padding: 2px 4px;
            background: url("../static.tumblr.com/3zmswwt/soKmzhmhg/install_button.png") rgba(0, 0, 0, .4) no-repeat;
            border: 1px solid rgba(0, 0, 0, 0.18);
            -webkit-border-radius: 2px;
            -moz-border-radius: 2px;
            border-radius: 2px;
            z-index: 100;
            top: -30px;
            right: 5px;
            position: fixed
        }

        a#install-button:hover {
            background: url("../static.tumblr.com/3zmswwt/soKmzhmhg/install_button.png") rgba(0, 0, 0, .32) no-repeat
        }

        span#install-theme-text {
            float: right;
            font: 400 12px Arial;
            text-shadow: 1px 1px 1px rgba(0, 0, 0, .08);
            color: white
        }

        #tumblr_controls {
            position: fixed;
            top: 0;
        }

        .like_button {
            position: absolute;
            opacity: 0
        }

        .like_button.liked {
            opacity: 1 !important
        }

        /*      End-Setting     */

        /*      Sidebar     */

        body.left #sidebar {
            left: 0
        }

        body.left #posts-container {
            margin: 0 0 0 270px
        }

        body.right #sidebar {
            right: 0
        }

        body.right #posts-container {
            margin: 0 270px 0 0
        }

        #sidebar {
            position: absolute;

            overflow-y: scroll;
            width: 270px;
            height: 100%;
            top: 0;
            padding: 25px 0;
            z-index: 30
        }

        #sidebar h2 {
            margin: 0 0 30px;
            text-transform: uppercase;
            letter-spacing: 1px;
            font: 700 11px "Montserrat";
            color: #555555
        }

        #sidebar a#avatar {
            display: block;
            margin: 0
        }

        #sidebar a#avatar img {
            max-width: 100%;
            border-radius: 2px
        }

        #sidebar a#avatar img:hover {
            opacity: .85
        }

        #sidebar h1 {
            margin: 10px 50px
        }

        #sidebar h1 a {

            font: 22px/1.8em "Montserrat", sans-serif;
            color: #444444
        }

        #sidebar #description {
            color: #888888
        }

        #sidebar #description a {
            text-decoration: underline;
            color: #888888
        }

        #sidebar #navigation li {
            list-style-type: none
        }

        #sidebar #navigation li a {

            text-transform: uppercase;
            font-size: 12px !important;;
            font: 13px/20px "Montserrat";
            color: #555555
        }

        #sidebar #navigation li a:hover {
            color: #888888
        }

        #sidebar #navigation li:last-child {
            margin: 0 !important
        }

        #sidebar #social {
            display: none;
            display: block;
            display: block;
            display: block;
            display: block;
        }

        #sidebar #social a {
            display: inline-block;
            width: 20px;
            height: 30px;
            margin: 2px 4px 2px 0;
            text-align: center;
            font: 14px/30px "icon";
            color: #555555
        }

        #sidebar #social a:hover {
            opacity: .6
        }

        #sidebar #search {
            width: 100%
        }

        #sidebar #search input[type="text"] {
            width: 100%;
            padding: 8px 10px 8px 30px;
            font: 400 11px "Helvetica Neue", sans-serif;
            color: #888888;
            background: rgba(136, 136, 136, .1);
            border: 0;
            box-shadow: 0 0 0 1px rgba(136, 136, 136, .2)
        }

        #sidebar #search span {
            float: left;
            margin: -21px 12px 0;
            font: 12px "icon";
            opacity: .6
        }

        #sidebar #search input:focus {
            outline: none;
            box-shadow: 0 0 0 1px rgba(136, 136, 136, .3)
        }

        #sidebar #instagram #instagram-feed {
            width: 170px;
            padding: 0;
            margin: 0;
            list-style: none
        }

        #sidebar #flickr #flickr-feed {
            padding: 0 !important;
            list-style: none;
            overflow: hidden
        }

        #sidebar #flickr #flickr-feed img {
            float: left
        }

        #sidebar #instagram #instagram-feed:after,
        #sidebar #flickr #flickr-feed:after,
        #sidebar #dribbble #dribbble-feed:after {
            content: "";
            display: block;
            height: 0;
            clear: both
        }

        #sidebar #instagram #instagram-feed img,
        #sidebar #flickr #flickr-feed img,
        #sidebar #dribbble #dribbble-feed img {
            float: left;
            width: 75px;
            height: auto;
            margin: 0 10px 10px 0;
            border-radius: 2px
        }

        #sidebar #twitter .content:hover,
        #sidebar #instagram #instagram-feed img:hover,
        #sidebar #flickr #flickr-feed img:hover,
        #sidebar #dribbble #dribbble-feed img:hover {
            opacity: .7
        }

        #sidebar #twitter .content {
            margin: 0 0 10px;
            color: #888888
        }

        #sidebar a#avatar,
        #sidebar #description,
        #sidebar #navigation,
        #sidebar #social,
        #sidebar #search,
        #sidebar #instagram,
        #sidebar #flickr,
        #sidebar #dribbble,
        #sidebar #twitter,
        #sidebar #credit {
            padding: 15px 50px
        }

        #sidebar #credit,
        #sidebar #credit a {
            font-size: 11px;
            color: #888888
        }

        #sidebar #credit a:hover {
            opacity: .6
        }

        #header {
            display: none;
            position: relative;
            padding: 20px;
            text-align: center
        }

        #header h1 {
            margin: 0
        }

        #header h1 a {

            font: 22px/1.8em "Montserrat", sans-serif;
            color: #444444
        }

        body.left a#slide {
            left: 30px
        }

        body.right a#slide {
            right: 30px
        }

        #header a#slide {
            position: absolute;
            top: 32px;
            width: 15px;
            height: 15px;
            text-align: center;
            z-index: 20
        }

        #header a#slide #icon {
            width: 18px;
            height: 3px;
            margin: 6px auto;
            background: #444444
        }

        #header a#slide #icon:after {
            content: "";
            position: absolute;
            width: 18px;
            height: 3px;
            bottom: 0;
            margin: 0 0 0 -9px;
            background: #444444
        }

        #header a#slide #icon:before {
            content: "";
            position: absolute;
            width: 18px;
            height: 3px;
            top: 0;
            margin: 0 0 0 -9px;
            background: #444444
        }

        /*      End-header     */

        #posts-container {
            position: relative
        }

        #posts {
            position: relative;
            margin: auto;
            padding: 40px 0
        }

        #post-info {
            padding: 20px;
            width: 90%;
            margin: 40px auto -10px;
            text-align: center
        }

        #post-info h3,
        #post-info p {
            display: inline;
            margin: 0;
            font: 12px "Montserrat", sans-serif
        }

        .entry {
            position: relative;
            overflow: hidden;
            width: 300px;
            margin: 0 10px 20px
        }

        .entry.tag-large {
            width: 620px
        }

        .entry p,
        .entry blockquote {
            margin: 0 0 20px
        }

        .entry p:last-child {
            margin: 0 !important
        }

        .entry .media {
            position: relative;
            border: 10px solid #ffffff
        }

        .entry .media iframe {
            display: block;
            width: 100%
        }

        .entry .photo {
            position: relative;
            border: 10px solid #ffffff;
            background: #111
        }

        .entry .photo img {
            width: 100%
        }

        .entry .photo a.overlay,
        .entry .media a.overlay {
            position: absolute;
            width: 100%;
            height: 100%;
            background: #000000;
            opacity: 0;
            z-index: 6
        }

        .entry .photo:hover a.overlay,
        .entry .media:hover a.overlay {
            opacity: .70
        }

        .entry .photo .photo-buttons,
        .entry .media .photo-buttons {
            position: absolute;
            top: 50%;
            width: 100%;
            margin: -20px 0 0;
            text-align: center;
            z-index: 7
        }

