            box-shadow: 0 3px 7px 2px rgba(0, 0, 0, .3);
            border-radius: 3px;
            z-index: 10
        }

        .entry .details ul.share:before {
            content: "";
            pointer-events: none;
            position: absolute;
            display: block;
            bottom: -10px;
            margin: 0 0 0 30px;
            padding: 0;
            width: 0;
            height: 0;
            border-left: 10px solid transparent;
            border-right: 10px solid transparent;
            border-top: 10px solid rgba(0, 0, 0, .8);
            background: transparent
        }

        .entry .details ul.share a {
            display: block;
            margin: 10px 0;
            list-style-type: none;
            color: #fff !important
        }

        .entry .details ul.share a:hover {
            opacity: .4
        }

        .entry .details ul.share a span {
            display: inline-block;
            width: 25px;
            font: 13px "icon";
            opacity: .8
        }

        .entry .text .question {
            margin: 0 0 30px;
            padding: 15px;
            background: rgba(119, 119, 119, .08);
            border-radius: 2px
        }

        .entry .text .odd,
        .entry .text .even {
            margin: 5px 0 0 0;
            padding: 10px;
            border-radius: 2px
        }

        .entry .text .odd {
            background: rgba(119, 119, 119, .08)
        }

        .entry .text a.link {
            display: block;
            position: relative;
            margin: 0 0 15px;
            padding: 15px;
            font: 13px/20px "Montserrat";
            color: #fff !important;
            background: #6e8296;
            border-radius: 2px
        }

        .entry .text a.link:after {
            content: "n";
            position: absolute;
            right: 15px;
            top: 50%;
            font: 35px/0 "icon";
            opacity: .1
        }

        .entry .quote h3 {
            letter-spacing: -1px;
            font: 400 20px "Georgia";
            line-height: 1.6em
        }

        .entry .text .quote-symbol {
            position: absolute;
            top: -15px;
            left: 10px;
            font: 160px "arial";
            opacity: .1
        }

        .entry .text .source {
            margin: 20px 0 0 0;
            text-align: right
        }

        .entry .text .source .odd {
            display: inline;
            background: transparent
        }

        /*      End-Entry       */

        #sidebar, #header, .entry, #post-info, #pagination a, #permalink .permalink-box, #loading, #infscr-loading img {
            background: #ffffff;
            -webkit-box-shadow: 0 1px 2px rgba(0, 0, 0, .1);
            box-shadow: 0 1px 2px rgba(0, 0, 0, .1)
        }

        /*      Pagination      */

        #pagination {
            position: relative;
            width: 90%;
            margin: 0 auto 120px
        }

        #pagination:after {
            content: "";
            display: block;
            height: 0;
            clear: both
        }

        #pagination a {
            position: absolute;
            display: inline-block;
            padding: 20px 25px;
            text-transform: uppercase;
            letter-spacing: 1px;
            font: 700 12px "Montserrat", sans-serif;
            color: rgba(85, 85, 85, .5)
        }

        #pagination a.exist {
            color: rgba(85, 85, 85, 1) !important
        }

        #pagination a#newer {
            left: 0
        }

        #pagination a#older {
            right: 0
        }

        #pagination a#newer:before {
            content: ",";
            vertical-align: top;
            margin: 0 20px 0 0;
            font: 15px "icon";
        }

        #pagination a#older:after {
            content: ".";
            vertical-align: top;
            margin: 0 0 0 20px;
            font: 15px "icon";
        }

        /*      End-Pagination      */

        /*      Permalink       */

        #permalink .permalink-box,
        #permalink .entry {
            display: block;
            width: 90% !important;
            max-width: 700px;
            margin: 20px auto 30px
        }

        #permalink .entry .photo {
            border-top: 25px solid #ffffff !important;
            border-left: 25px solid #ffffff !important;
            border-right: 25px solid #ffffff !important;
        }

        #permalink .permalink-box {
            padding: 20px
        }

        #permalink .permalink-box h2 {
            margin: 0 0 20px
        }

        #permalink .permalink-box ol.notes {
            margin: 20px 0 0;
            list-style-type: none
        }

        #permalink .permalink-box ol.notes li.note {
            padding: 3px 0
        }

        #permalink .permalink-box ol.notes li.more_notes_link_container {
            border-top: 1px solid #efefef
        }

        #permalink .permalink-box ol.notes li.more_notes_link_container,
        #permalink .permalink-box ol.notes li.more_notes_link_container a.more_notes_link {
            text-transform: uppercase;
            letter-spacing: 1px;
            font: 11px Montserrat;
            color: #777777
        }

        #permalink .permalink-box ol.notes li.like:after,
        #permalink .permalink-box ol.notes li.reblog:after,
        #permalink .permalink-box ol.notes li.reply:after,
        #permalink .permalink-box ol.notes li.answer:after,
        #permalink .permalink-box ol.notes li.original_post:after {
            float: right;
            margin: -17px 0 0 0;
            font: 14px icon;
            opacity: .5
        }

        #permalink .permalink-box ol.notes li.like:after {
            content: "z"
        }

        #permalink .permalink-box ol.notes li.reblog:after {
            content: "c"
        }

        #permalink .permalink-box ol.notes li.reply:after {
            content: "k";
            font: 13px icon
        }

        #permalink .permalink-box ol.notes li.answer:after {
            content: "k";
            font-size: 11px
        }

        #permalink .permalink-box ol.notes li.original_post:after {
            content: "d"
        }

        #permalink .permalink-box ol.notes img {
            display: inline;
            padding: 0 10px 0 0
        }

        #permalink .permalink-box ol.notes li.more_notes_link_container {
            margin: 30px 0 0 0;
            padding: 25px 0 0 0
        }

        /*      Animation       */

        body.slide #tumblr_controls,
        body.slide a#install-button {
            opacity: 0
        }

        body.slide a#slide #icon {
            background: rgba(255, 255, 255, 0) !important
        }

        body.slide a#slide #icon:before {
            top: 6px !important;
            -webkit-transform: rotate(45deg);
            transform: rotate(45deg)
        }

        body.slide a#slide #icon:after {
            bottom: 6px !important;
            -webkit-transform: rotate(-45deg);
            transform: rotate(-45deg)
        }

        body.left.slide #sidebar {
            left: 0
        }

        body.right.slide #sidebar {
            right: 0
        }

        body.left.slide #posts-container {
            -webkit-transform: translateX(270px);
            transform: translateX(270px)
        }

        body.right.slide #posts-container {
            -webkit-transform: translateX(-270px);
            transform: translateX(-270px)
        }

        #infscr-loading img {
            position: absolute;
            width: 45px;
            height: 45px;
            bottom: 70px;
            left: 50%;
            margin: 0 0 0 -27px;
            padding: 12px
        }

        #loading {
            position: absolute;
            width: 50px;
            height: 50px;
            top: 200px;
            left: 50%;
            margin: 0 0 0 -25px;
            border-radius: 2px;
            z-index: 100;
            background: url('../static.tumblr.com/j6tha7z/AFfmuponn/ajax-loader.gif') no-repeat center #fff;
            pointer-events: none;
            opacity: 0;
            filter: alpha(opacity=0)
        }

        #posts.loading,
        #permalink #loading.loading {
            opacity: 0
        }

        #loading.loading,
        #permalink #posts.loading {
            opacity: 1
        }

        #posts, #loading {
            -webkit-transition: opacity 1s ease, height .5s ease;
            transition: opacity 1s ease, height .5s ease
        }

        @-webkit-keyframes loaded {
            0% {
                opacity: 0;
                -webkit-transform: translateY(60px);
                transform: translateY(60px)
            }
            100% {
                opacity: 1;
                -webkit-transform: translateY(0);
                transform: translateY(0)
            }
        }

        @keyframes loaded {
            0% {
                opacity: 0;
                -webkit-transform: translateY(60px);
                transform: translateY(60px)
            }
            100% {
                opacity: 1;
                -webkit-transform: translateY(0);
                transform: translateY(0)
            }
        }

        .entry.loaded {
            -webkit-animation: loaded .8s ease-out;
            animation: loaded .8s ease-out
        }

        /*      Responsive      */

        @media screen and (max-width: 600px) {

            #header {
                display: block
            }

            body.left #sidebar {
                left: -270px
            }

            body.right #sidebar {
                right: -270px
            }

            #posts-container {
                margin: auto !important
            }

            #posts {
                width: 90% !important;
                max-width: 500px
            }

            .entry,
            #permalink .permalink-box {
                width: 100%;
                margin: 0 auto 20px !important
            }

            #permalink .permalink-box {
                text-align: center !important
            }

            #permalink .permalink-box ol.notes img,
            #permalink .permalink-box ol.notes li:after {
                display: none
            }

        }

        /*      End-Responsive      */

        /*      Adjustments     */

        .entry, #post-info, .entry .photo, .entry a.overlay, #pagination a, .permalink-box, #infscr-loading img {
            border-radius: 3px
        }

        #pagination {
            opacity: 0 !important
        }

        #pagination a {
            padding: 0 !important;
            height: 0 !important
        }

        #posts {
            padding: 40px 0 160px
        }


